import React from "react";
import "../../../map.css";
import "./style.css";

const A3 = () => (
   
        <div id="a3">
          <img id="acorns" src="https://truffle-shuffle.s3.us-east-2.amazonaws.com/Assets/img/Quercus_nigra_acorns_01jpg.jpg" 
            alt="acorns" />
          <div>
            <h3>
              Become a registered user
            </h3>
            <h4>Enhance our library</h4>
          </div>

        </div>
      )
      
export default A3;
